	//时间戳转时间
	unixToDate: function(unixTime, type) {
		var time = new Date(unixTime);
		if(type == null) {type = 1;}
		var y = time.getFullYear(),m = time.getMonth() + 1,d = time.getDate(),h = time.getHours(),mm = time.getMinutes(),s = time.getSeconds(),ymdhis;
		switch(type) {
			case 1:
				ymdhis = y + '-' + add0(m) + '-' + add0(d) + ' ' + add0(h) + ':' + add0(mm) + ':' + add0(s);
				break;
			case 2:
				ymdhis = y + '-' + add0(m) + '-' + add0(d)
				break;
			case 3:
				ymdhis = add0(h) + ':' + add0(mm) + ':' + add0(s);
				break;
		}
		//var ymdhis = y + '-' + add0(m) + '-' + add0(d) + ' ' + add0(h) + ':' + add0(mm) + ':' + add0(s);
		return ymdhis;
		function add0(m) {
			return m < 10 ? '0' + m : m;
		}
	},
	//时间字符串转时间
	dateToUnix: function(stringTime) {
		var unix = Number(new Date(stringTime.replace(new RegExp(/-/gm) ,"/")));
		//unix = unix / 1000;
		return unix;
	},
