	//合并行
	mergeCells : function(data, fieldName, colspan) {
		var $this = $(this);
		if(data.length == 0) {
			alert("不能传入空数据");
			return;
		}
		var numArr = [];
		var value = data[0][fieldName];
		var num = 0;
		for(var i = 0; i < data.length; i++) {
			if(value != data[i][fieldName]) {
				numArr.push(num);
				value = data[i][fieldName];
				num = 1;
				continue;
			}
			num++;
		}
		var merIndex = 0;
		for(var i = 0; i < numArr.length; i++) {
			$this.bootstrapTable('mergeCells', {
				index: merIndex,
				field: fieldName,
				colspan: colspan,
				rowspan: numArr[i]
			})
			merIndex += numArr[i];
		}
	},
	//合并列
	mergeColspan : function(data, fieldNameArr) {
		var $this = $(this)
		if(data.length == 0) {
			alert("不能传入空数据");
			return;
		}
		if(fieldNameArr.length == 0) {
			alert("请传入属性值");
			return;
		}
		var num = -1;
		var index = 0;
		for(var i = 0; i < data.length; i++) {
			num++;
			for(var v in fieldNameArr) {
				index = 1;
				if(data[i][fieldNameArr[v]] != data[i][fieldNameArr[0]]) {
					index = 0;
					break;
				}
			}
			if(index == 0) {
				continue;
			}
			$(this).bootstrapTable('mergeCells', {
				index: num,
				field: fieldNameArr[0],
				colspan: fieldNameArr.length,
				rowspan: 1
			});
		}
	},
	
